import { Box, Button, Stack } from '@mui/material';

const options = [
  {
    title: 'Employee Infomation',
  },
  {
    title: 'Contract Information',
  },
  {
    title: 'Employment Details',
  },
  {
    title: 'Salary & Wages',
  },
  {
    title: 'Others',
  },
];

function Option() {
  return (
    <Box>
      {options.map((text, index) => (
        <Button
          key={index}
          variant="contained"
          sx={{
            textTransform: 'none',
            padding: '6px 16px',
            minWidth: '180px',
            height: '48px',
            fontWeight: '400',
            fontFamily: 'SVN-Sofia-Regular',
            fontSize: '14px',
            marginRight: '4px',
            color: '#fff',
          }}
        >
          {text.title}
          <svg width="21" height="20" viewBox="0 0 21 20" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path
              d="M10.4998 18.3337C15.1022 18.3337 18.8332 14.6027 18.8332 10.0003C18.8332 5.39795 15.1022 1.66699 10.4998 1.66699C5.89746 1.66699 2.1665 5.39795 2.1665 10.0003C2.1665 14.6027 5.89746 18.3337 10.4998 18.3337Z"
              stroke="#FFB7B9"
              strokeWidth="2"
              strokeLinecap="round"
              strokeLinejoin="round"
            ></path>
            <path
              d="M10.5 6.66699V10.0003"
              stroke="#FFB7B9"
              strokeWidth="2"
              strokeLinecap="round"
              strokeLinejoin="round"
            ></path>
            <path
              d="M10.5 13.333H10.5083"
              stroke="#FFB7B9"
              strokeWidth="2"
              strokeLinecap="round"
              strokeLinejoin="round"
            ></path>
          </svg>
        </Button>
      ))}
    </Box>
  );
}

export default Option;
